import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import padrao from '../models/IronMan.patt';

class TelaRA  extends Component {

    constructor() {
        super();

    }

    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col">
                        <div className="conteinerRA">
                            <a-scene embedded arjs="sourceType: webcam;">
                                <a-marker type='pattern' url='/models/wolf.patt'>
                                    <a-entity obj-model="obj: url(/models/wolf.obj); mtl: url(/models/wolf.mtl)"> </a-entity>
                                </a-marker>
                                <a-entity camera>
                                </a-entity>
                            </a-scene>
                        </div>
                    </div>
                </div>
                <div className="row">
                    <div className="col text-center">
                        <Link to="/inicio">
                            <span className="btn btn-primary">Voltar</span>
                        </Link>
                    </div>
                </div>
            </div>
        );
    }
}

export default TelaRA;
